@RuleOfSeventyTwo It's funny that you want an explanation from me, but you shutting it down as a dividend stock in your comment pays you no mind.  

1st off, lets take the stability of Microsoft, it's not going anywhere, the dividend safety is so comforting.  Now lets take a look at the payout ratio, 40% is nothing, especially when you're talking about the kind of capital Microsoft rakes in, meaning 60% of their profits are in pay to potentially increase a dividend.  They dividend has a 10% annual growth rate, which is insane.  Meaning, 20 years down the road, if it stayed at that rate, they would be paying a $13.  Now that is unlikely, but that's how this works.  Unless you're dumping huge amounts of capital into a stock, finding companies that have great cash flow and are still increasing their dividends at a high clip is the way to go, especially when you're thinking 20 years down the road.  The room for dividend growth in Microsoft is much higher than a company like ATT, especially when you figure in potential value of the share price climbing with it.  

Dividend yield is only one piece of the pie, you need to take into account Dividend growth, dividend safety, payout ratio, market cap & cash flow.

